object RandomOptions {
    def apply[T](opts: (T, Int)*) ={
        val randomOptions = new RandomOptions[T]()
        randomOptions.totalWeight = (0 /: opts)(_ + _._2) // 计算出来总的比重
        opts.foreach{
            case (value, weight) => randomOptions.options ++= (1 to weight).map(_ => value)
        }
        randomOptions
    }


